            title:"JavaScript",
            starts:5,
        },
        {
            year:"2020",
            src:css,
            title:"CSS",
            starts:5,
        },
        {
            year:"2020",
            src:node,
            title:"Node.js",
            starts:5,
        },
        {
            year:"2020",
            src:react,
            title:"React",
            starts:5,
        }
    ]

    return (
        <div>
            <h1>Hola</h1>
        </div>
    )
}

export default Tecnologias
